import React from 'react';
import './Titulo.css';

function Titulofinal(props){
    return(
      <div className=".App-titulo"><label type="text" name="nombredelacaja" placeholder={props.PlaceHolderUsuario}/>hola</div>  
    )
  }
export default Titulofinal;
